// Error
const GET_ERRORS = 'error/GET_ERRORS';
const GET_ERRORS_SUCCESS = 'error/GET_ERRORS_SUCCESS';

// Clear Error
const CLEAR_ERRORS = 'error/CLEAR_ERRORS';
const CLEAR_ERRORS_SUCCESS = 'error/CLEAR_ERRORS_SUCCESS';

const types = {
  GET_ERRORS,
  GET_ERRORS_SUCCESS,
  CLEAR_ERRORS,
  CLEAR_ERRORS_SUCCESS,
};

export default types;
